import React from "react";
import {
  Grid,
  makeStyles,
  TextField,
  Card,
  FormControl,
  InputLabel,
  Select,
} from "@material-ui/core";
import dayjs from "dayjs";

dayjs.locale("zh-hk");
const useStyles = makeStyles(() => ({
  root: {},
  content: {
    padding: "15px",
  },
}));

const ListeningAidInfo = (props) => {
  const classes = useStyles();
  const { states, handleOnChange } = props;

  return (
    <Card className={classes.content}>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <TextField
            label="name"
            size="small"
            value={states.name}
            onChange={handleOnChange("name")}
          />
        </Grid>

        <Grid item xs={12}>
          <TextField
            label="Building Name"
            size="small"
            fullWidth
            value={states.buildingName}
            onChange={handleOnChange("buildingName")}
          />
        </Grid>
      </Grid>
    </Card>
  );
};

export default ListeningAidInfo;
